import { types as authTypes } from '../actions/auth';
import { types as itemTypes } from '../actions/item';
import { types } from '../actions/user';

// eslint-disable-next-line
const profile_pic =
  'data:image/png;base64,';

const initialState = {
  userLoadedError: false,
  loading: true,
  address: '',
  addrstatus: '',
  display_name: '',
  profile_pic,
  postcode: '',
  location: {},
  preferred_distance_unit: 'Miles',
  preferred_distance: 5,
  filters: {
    unit: 'Miles',
    distance: 5,
    category: [],
    expiry: '',
    sortBy: 'distance',
    long: 0,
    lat: 0,
    limit: 25, // not being used currently
    page: 1
  }
};

export default (state = { ...initialState }, action) => {
  switch (action.type) {
    case types.USER_LOADED:
      return {
        ...state,
        ...action.user,
        loading: false,
        filters: {
          ...state.filters,
          unit:
            'preferred_distance_unit' in action.user
              ? action.user.preferred_distance_unit
              : state.filters.unit,
          distance:
            'preferred_distance' in action.user
              ? action.user.preferred_distance
              : state.filters.distance,
          long:
            'location' in action.user
              ? action.user.location.coordinates[0]
              : state.filters.long,
          lat:
            'location' in action.user
              ? action.user.location.coordinates[1]
              : state.filters.lat
        }
      };
    case types.USER_LOAD_FAILURE:
      return {
        ...state,
        userLoadedError: true
      };
    case authTypes.LOGOUT_SUCCESS:
      return {
        ...initialState,
        userLoadedError: false
      };
    case types.GET_USER_ADDRESS:
      return {
        ...state,
        address: action.payload,
        addrstatus: action.payload.addrstatus
      };
    case types.GET_USER_ADDRESS_ERROR:
      return {
        ...state,
        address: action.payload,
        addrstatus: action.payload.addrstatus
      };
    case `${types.UPDATE_PROFILE}_FULFILLED`:
      return {
        ...state,
        ...action.payload.data,
        filters: {
          ...state.filters,
          long: action.payload.data.location.coordinates[0],
          lat: action.payload.data.location.coordinates[1]
        }
      };
    case itemTypes.SEARCH_ITEMS:
      return {
        ...state,
        filters: action.filters
      };
    default:
      return state;
  }
};
